import React from 'react';
import SurfSpot from './SurfSpot';

const Home = ({ data, handleVisited }) => {
  const totalSpots = data.length;
  const filteredSpots = data.filter((surfspot) => surfspot.visited).length;
  const percentage = Math.floor((filteredSpots / totalSpots) * 100);

  return (
    <div className="home">
      <progress value={filteredSpots} max={totalSpots} className="progress">
        {percentage}%
      </progress>
      {data && <SurfSpot spots={data} handleVisited={handleVisited} />}
    </div>
  );
};

export default Home;
